import React from 'react';

function ProductCard({ data }) {
  return (
    <div>
      <h2>Данные в дочернем компоненте:</h2>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            <strong>{item.titleProduct}</strong>: {item.overview}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ProductCard;
